INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_heading`, `field_body`, `field_price`, `field_tagline`, `field_fullName`, `field_hours`, `field_phoneNumber`, `field_streetAddress`, `field_reservationNote`, `field_caption`, `field_metaDescription`, `field_hideComments`, `field_disqusId`, `field_newsUrl`, `field_bio`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('130', '131', 'en_us', 'i-sg9LhRq 1080', NULL, '<h3>our story</h3><p>Food an essential part of all family and social interactions in the Middle East where people grow up with intense flavors, colorful, vibrant foods fresh from the marketplace, prepared simply and with a lot of passion. Aromatic herbs fill the streets and a spirit of warmth and generosity exudes welcome at any table.</p><p>Here at mamnoon, we share these strengths brought with us from Lebanon and Syria to the new world of Seattle – where modern curiosity, compassion, progressive values and tolerance are paving the way for harmonious integration and celebration of cultures and flavors.</p>', '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, '2014-07-23 19:58:00', '2014-09-11 23:05:30', 'b8d2b8b1-7632-4154-b225-b1f356620f04');
