m.&nbsp;<\\/p><p>This image from his \\u2018Signares\\u2019 series explores the role of cloth and clothing during African colonization and their subsequent meaning in an era of Westernization. Powerful Signarese women were often the \\u2018official wives\\u2019 of European colonizers for the duration of their stay. Often celebrated for their beauty and business mind, these women played an important role in the socio-economic development of Senegal.<\\/p>\"}},\"490\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"481\"],\"position\":\"left\"}},\"494\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"482\"],\"position\":\"right\"}},\"491\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>These photographs by Iranian photographer <strong>Babak Kazemi<\\/strong> are a contemporary interpretation of the legend of Shirin and Farhad.<\\/p><p>As the story goes, Farhad was a stonemason who was in love with the beautiful Shirin, who was also desired by the powerful King Khosrow.  Shirin knew of Farhad\\u2019s love and used it to make the King jealous.  King Khosrow attempted to get rid of Farhad by ordering him to complete an impossible task: to win Shirin\\u2019s hand, he must move a mountain. Farhad\\u2019s love proves to be stronger than either the King or Shirin had<\\/p><p>imagined, and he takes on the task with zeal. Amazed at the reports of Farhad\\u2019s progress, Shirin travel to the mountain to see for herself. After the long journey, though, she faints with fatigue and Farhad places both Shirin and her horse on his shoulders and carries them back to the palace. <\\/p><p>Kazemi revisits this 16th- century tragedy to comment on the contemporary struggle of lovers who must leave their homeland to find the freedom to love as they choose. For the artist, the story reveals the message that love can overcome even the most difficult situations.&nbsp;<\\/p>\"}},\"492\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\"