tuations.&nbsp;<\\/p><hr id=\\\"horizontalrule\\\">\"}},\"492\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"483\"],\"position\":\"center\"}},\"493\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p><strong>Hassan Hajjaj<\\/strong>, who was born in Morocco and raised in London, is a master of multiple mediums, including furniture, fashion, interior, and record album covers. Hajjaj synthesized these all into a series of sensational photo-portraits in \\u2018Kesh Angels\\u2019. These transcultural and trans-medium images depict a distinct subculture of young Moroccan women who work as henna tattoo artists and travel Marrakesh on motorbike.<\\/p><p>With pride and ease, the women pose with their bikes, wearing veils and abayas, against vivid backdrops. These photos are a jarring mix of old and new, East and West, global and local. Hajjaj plays with and upends stereotypes, presenting his subjects as both traditional and defiantly modern, which infuses his photos with electrifying tension.<\\/p>\"}}}}}', '2014-09-10 21:59:21', '2014-09-10 21:59:21', 'f91eb324-5353-4574-b85d-1c63729807ac');
