a prepared Lebanese, Syrian or Persian food and served at our dinners and parties.  Of course the foods are delicious and accessible and she\\u2019s an amazing cook, but the main reason has to do with the reception and the way guests are treated the <em>accueil<\\/em>.<\\/p><p>The feedback from our friends is that our cultures are welcoming, accommodating, adaptable, progressive and contemporary but more importantly they remember the visceral delicious sensations generated by eating the foods, taking in the smells and sights. There is a direct correlation between a positive visceral stimulus with an unfamiliar context, resulting in this context being familiarized in a very positive way.<\\/p><p>This was the \\u201caha\\u201d moment for us and the start of the mission \\u2013 we got excited about the prospect of building a business around these principles and to create the postive visceral stimuli and experiences accessible in the broadest way possible. It was also clear that we hoped to for the mission to be a progressive beacon that the local culture can be proud of.<\\/p><p>This was the genus of mamnoon \\u2013 and a fantastic problem for a geek like me to go work on. I don\\u2019t have a culinary background; I am not a foodie or wine connoisseur. I am not a typical sample of the Lebanese or Syrian cultures either, but I am very curious, I am a tinkerer and have a lot of humility to try new things and fail at them and I have no issues calling for help if I need it.<\\/p>\"}},\"503\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"497\"],\"position\":\"right\"}},\"504\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>The mamnoon project was a complete collaboration between Racha and me entering into many areas that we have never been before, and like every other project I have been in, mamnoon is a headlong full contact affair \\u2013 made more intense by the fact that Racha is fully in it as well. This is a new and intense family dynamic. We both bring it home and live it day and night. It has helped us do better for mamnoon in a very natural way, and has added a dimension of authenticity that is unparalleled.<\\/p><p>I am talking about mamnoon in very personal way, but what really makes it relevant and vibrant to all of us today is the team that has gelled behind the mission. We are simply blessed to have some of the most talented individuals in the industry believe in what we are trying to do and to have taken on the mission as their own. This is a testament that what we have lived and believe in is universal. The excitement, passion and drive we see in the staff translates to amazing guest experiences and a net cultural transfer \\u2013 all of it for the better.<\\/p><p>As the main geek at mamnoon my work is endless, there is a lot I need to do tinkering here and there \\u2013 helping on the technology, working on processes and learning what it is that we can do to make the mamnoon experience universally compelling. If you come by one day and see me around with a laptop, measuring tape, on top of a ladder, under a piece of equipment, or talking to a guest- don\\u2019t be surprised, I\\u2019m just geeking out. <\\/p><p><em>Wassef<\\/em><\\/p>\"}}}}}', '2014-09-10 22:10:20', '2014-09-10 22:10:20', '7ecce2aa-cfb6-4bb6-a63a-06231674ed0e');
