mic. We both bring it home and live it day and night. It has helped us do better for mamnoon in a very natural way, and has added a dimension of authenticity that is unparalleled.<\\/p><p>I am talking about mamnoon in very personal way, but what really makes it relevant and vibrant to all of us today is the team that has gelled behind the mission. We are simply blessed to have some of the most talented individuals in the industry believe in what we are trying to do and to have taken on the mission as their own. This is a testament that what we have lived and believe in is universal. The excitement, passion and drive we see in the staff translates to amazing guest experiences and a net cultural transfer \\u2013 all of it for the better.<\\/p><p>As the main geek at mamnoon my work is endless, there is a lot I need to do tinkering here and there \\u2013 helping on the technology, working on processes and learning what it is that we can do to make the mamnoon experience universally compelling. If you come by one day and see me around with a laptop, measuring tape, on top of a ladder, under a piece of equipment, or talking to a guest- don\\u2019t be surprised, I\\u2019m just geeking out. <\\/p><p>Wassef<\\/p>\"}}}}}', '2014-09-10 22:12:23', '2014-09-10 22:12:23', '8214ca16-b344-4fab-957b-78d6d4386ba2');
INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `num`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('176', '509', '6', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"400\",\"title\":\"Spotlight: Lounge Screens\",\"slug\":\"spotlight-lounge-screens\",\"postDate\":1396594800,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"\",\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"new1\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"505\"],\"position\":\"full\"}},\"new2\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>They do more than provide some intimacy and sound-buffering in our lounge: the laser cut poplar wood screens built for us by Seattle\\u2019s immensely talented graypants studios are an integral part of the aesthetic and flow of our restaurant. <em>Mashrabiya<\\/em> are latticed wood screens that are a common fixture in Middle Eastern homes and are designed for a combination of shade, privacy, and air circulation. Our screens take elements of the traditional <em>mashrabiya<\\/em> and add a Northwest flair-- the varying levels of opacity created by the star cut-outs were inspired by the patterns of light and shadows in a forest of trees. The wooden screens are a beautiful embodiment of the balance between old and new world, tradition and innovation, and beauty and function found at mamnoon.<\\/p>\"}},\"new3\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"506\",\"507\"],\"position\":\"center\"}},\"new4\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<hr><p>Fun fact: the leftover cut-outs from the screens are used as holders for specials and announcements on table throughout the restaurant.<\\/p>\"}},\"new5\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"508\"],\"position\":\"center\"}},\"new6\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>Check out&nbsp;<a href=\\\"http:\\/\\/www.graypants.com\\/project\\/mamnoon-screens\\/?lang=us\\\" target=\\\"_blank\\\">graypant\\u2019s website<\\/a>&nbsp;for more images of the screens and details on other awesome projects they have going on.<\\/p>\"}}}}}', '2014-09-10 22:18:25', '2014-09-10 22:18:25', 'dabc3e7a-0b63-468a-a4ff-af95b1cd3d78');
INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `num`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('177', '509', '6', '1', 'en_us', '2', '', '{\"typeId\":\"6\",\"authorId\":\"400\",\"title\":\"Spotlight: Lounge Screens\",\"slug\":\"spotlight-lounge-screens\",\"postDate\":1396594800,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"\",\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"510\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"505\"],\"position\":\"full\"}},\"511\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>They do more than provide some intimacy and sound-buffering in our lounge: the laser cut poplar wood screens built for us by Seattle\\u2019s immensely talented graypants studios are an integral part of the aesthetic and flow of our restaurant. <em>Mashrabiya<\\/em> are latticed wood screens that are a common fixture in Middle Eastern homes and are designed for a combination of shade, privacy, and air circulation. Our screens take elements of the traditional <em>mashrabiya<\\/em> and add a Northwest flair-- the varying levels of opacity created by the star cut-outs were inspired by the patterns of light and shadows in a forest of trees. The wooden screens are a beautiful embodiment of the balance between old and new world, tradition and innovation, and beauty and function found at mamnoon.<\\/p>\"}},\"512\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"506\"],\"position\":\"center\"}},\"new1\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"516\"],\"position\":\"center\"}},\"513\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<hr>\\r\\n<p>Fun fact: the leftover cut-outs from the screens are used as holders for specials and announcements on table throughout the restaurant.<\\/p>\"}},\"514\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"508\"],\"position\":\"center\"}},\"515\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>Check out&nbsp;<a href=\\\"http:\\/\\/www.graypants.com\\/project\\/mamnoon-screens\\/?lang=us\\\" target=\\\"_blank\\\">graypant\\u2019s website<\\/a> for more images of the screens and details on other awesome projects they have going on.<\\/p>\"}}}}}', '2014-09-10 22:19:03', '2014-09-10 22:19:03', '1ffc6f50-1ba9-4a9a-b24b-dd82e983e8d1');
