":\"1\",\"fields\":{\"body\":\"<p>Check out&nbsp;<a href=\\\"http:\\/\\/www.graypants.com\\/project\\/mamnoon-screens\\/?lang=us\\\" target=\\\"_blank\\\">graypant\\u2019s website<\\/a> for more images of the screens and details on other awesome projects they have going on.<\\/p>\"}}}}}', '2014-09-10 22:26:08', '2014-09-10 22:26:08', '4718ac58-e14f-413e-9f9e-ec5d7c7d7484');
INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `num`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('179', '520', '6', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"400\",\"title\":\"I Thought You Were Closed on Mondays? An update on what\'s been going on with mamnoon junoon.\",\"slug\":\"i-thought-you-were-closed-on-mondays-an-update-on-whats-been-going-on-with-mamnoon-junoon\",\"postDate\":1394780400,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"\",\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"new1\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>Two junoons into our newly launched Monday night series and we are off to a rocking start! Mamnoon junoon was hatched as a way to bust outside the box and serve as a creative and fun way to explore aspects of the food and culture of the levant that we may not fit inside the repertoire of our normal dinner service.<\\/p><p>Our kickoff junoon event was a six course Moroccan feast that highlighted many of the dishes owner Wassef Haroun and sous chef Sean Dominoski discovered on a trip to Morocco last year. As mamnoon is a Syrian, Lebanese, and Persian restaurant, this junoon was a great chance to experiment with the food of a country that, while geographically close, is really pretty different than the flavors our kitchen usually employs. Some of the highlights from the menu were the merguez (harissa and lamb sausage), seven vegetable tajine with hand-rolled couscous, and a savory goat cheese and herb pastry.<\\/p>\"}},\"new2\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"518\"],\"position\":\"center\"}},\"new3\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>We went in a totally different direction for the next month\\u2019s junoon, this time choosing to focus on engaging more than just your taste buds. MamnoonTV explored the videos and images of the levant in a rethinking of a night at the theater. We had projection screens set up throughout the restaurant playing clips from various Arabic TV show and music videos, and the entertainment was paired with theater-style snacks: jibneh nachos, za\\u2019atar popcorn, kefta sliders, and sujuk hot dogs.<\\/p>\"}},\"new4\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"519\"],\"position\":\"center\"}},\"new5\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>If you have suggestions for creative, entertaining, or simply delicious events, we\\u2019d love to hear from you! Drop us a line on the blog or on our&nbsp;<a href=\\\"https:\\/\\/www.facebook.com\\/mamnoonrestaurant\\\" target=\\\"_blank\\\">Facebook page<\\/a>.<\\/p>\"}}}}}', '2014-09-10 22:32:11', '2014-09-10 22:32:11', '8910cb8b-1522-45a8-8c23-a74ae6aadc46');
INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `num`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('180', '527', '6', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"400\",\"title\":\"mamnoonTV coming to you live march 3rd\",\"slug\":\"mamnoontv-coming-to-you-live-march-3rd\",\"postDate\":1393315200,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"\",\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"new1\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"526\"],\"position\":\"center\"}},\"new2\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>mamnoonTV is the next addition in our monthly mamnoon junoon dinner series. Join us on monday, march 3rd for an evening that is guaranteed to turn your idea of a night at the theater on it\'s head.<\\/p><p>Our talented and twisted kitchen has prepared a menu of theater-themed dishes inspired by the tastes and flavors of mamnoon. Enjoy delicacies like za\'atar popcorn, jibneh nachos and kefta sliders against a backdrop of the videos and images of the levant.<\\/p><p>This playful and casual evening is a mamnoon rethinking of a classic. Come break bread with friends and treat all your senses to the magic of the middle east. <\\/p><p>Call 206.906.9606 or visit&nbsp;<a href=\\\"http:\\/\\/www.mamnoonrestaurant.com\\/\\\">http:\\/\\/www.mamnoonrestaurant.com\\/<\\/a> for reservations<\\/p>\"}}}}}', '2014-09-10 22:45:39', '2014-09-10 22:45:39', '2bf1bbc9-ab93-4e83-a771-24033f4f27c9');
