 bass, chermoula, herb salad<\\/em>\\r\\n<\\/p>\\r\\n<p>\\r\\n\\t<em><br>\\r\\n\\t<\\/em>\\r\\n<\\/p>\\r\\n<p style=\\\"text-align: center;\\\">\\r\\n\\t<strong>friandises<\\/strong>\\r\\n<\\/p>\\r\\n<p style=\\\"text-align: center;\\\">\\r\\n\\t<strong><em>treats<\\/em><\\/strong>\\r\\n<\\/p>\\r\\n<p style=\\\"text-align: center;\\\">\\r\\n\\tgazelle horns\\r\\n<\\/p>\\r\\n<p style=\\\"text-align: center;\\\">\\r\\n\\ttahini cookies\\r\\n<\\/p>\\r\\n<p style=\\\"text-align: center;\\\">\\r\\n\\ttangerines\\r\\n<\\/p>\"}},\"540\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>Dinner is $65 per person and does not include gratuity, tax and beverage. We apologize for the inconvenience but we are unable to make substitutions as it is a set menu. Reservations are required for the event as space is limited. Please note that because of the communal nature of the meal, parties less than 8 may be grouped at a table with others. If your party prefers to be at a private table please make a note on your reservation and we will try our best to accommodate, but no promises. Reservations can be made at <a href=\\\"http:\\/\\/mamnoonrestaurant.com\\/\\\">http:\\/\\/mamnoonrestaurant.com<\\/a> or at 206.906.9606.<\\/p><p>Mamnoon to you!<\\/p>\"}}}}}', '2014-09-10 23:00:20', '2014-09-10 23:00:20', '68985eba-3abd-495b-8ec1-8457a16a90f4');
