d who I am.<\\/p>\"}},\"559\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"552\"],\"position\":\"right\"}},\"560\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>There\\u2019s a difference between feeding someone and celebrating a cuisine. The restaurants that are out there that serve large quantities of very inexpensive Middle Eastern food are not really celebrating the cuisine and they\\u2019re not really celebrating the culture. There\\u2019s beauty that exists within this food and there\\u2019s a level of preparation that must take place. We\\u2019re taking something that is inherently family style and rustic and presenting it with an aesthetic and a refinement that doesn\\u2019t move away from the fundamentals, but maybe makes it taste just a little bit better or look a little bit more beautiful. To have an outlet to really showcases that and starts to use more celebrated ingredients&mdash;  local meat and beautiful organic produce&mdash; and to bring those elements together is something that hasn\\u2019t really been done before with this food. What we do here is very focused. It doesn\\u2019t mean that we can\\u2019t incorporate the same elements of \\u2018local, organic, sustainable\\u2019 that other Seattle restaurants are depending upon and building their name upon, we use some of that, but we\\u2019re doing it in a way that\\u2019s intensely focused. We\\u2019re working within pretty rigid parameters when you think about it and as much as we might do something that is maybe outside of the box of Middle Eastern cuisine, it still has to have that authenticity.<\\/p>\"}},\"561\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"553\"],\"position\":\"left\"}},\"562\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>We\\u2019ve changed so much in the last year and I think the evolution will continue. It\\u2019s necessary for a restaurant to evolve because if you don\\u2019t, you become static and boring and you become an experience that somebody\\u2019s already had. Part of the reason we\\u2019re able to do what we\\u2019re doing now is that there\\u2019s a trust that we\\u2019ve built that has allowed us a little bit more creative freedom. It\\u2019s allowed us to start to pull ingredients that are decidedly northwest&mdash;on one plate we are celebrating two places at once. When we first opened, it was really more about celebrating the origins and at points we had to use ingredients that were out of season in order to hit all the authentic dishes. But right now you\\u2019re looking at a Middle Eastern restaurant that doesn\\u2019t have tabbouleh on the dinner menu. That\\u2019s not something that could have happened when we first opened. We had to prove that we could do all of those other things first and provide a sense of comfort through authenticity.  But we showed that we are restaurant with sincerity and some semblance of an old soul, so we were able to take the cuisine and push it forward. And I hope that in the future we\\u2019ll start to move away from being somewhat of a black sheep of a restaurant. There was a feeling in the beginning that we were a little bit of a novelty. But we\\u2019re moving into a place where we\\u2019re being taken very seriously as a restaurant, and not just a Middle Eastern restaurant.<\\/p>\"}},\"563\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"554\"],\"position\":\"right\"}},\"564\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>I think people who are really observant don\\u2019t necessarily look for inspiration but stumble upon it. I could be inspired by a conversation that I have with Racha and Wassef about a memory from their childhood, or it could be a memory of my own, or it could be going to a 7-11 at 3 o\\u2019clock in the morning and seeing something that I find really delicious. For me, the most important thing about inspiration is that it requires a harmony between two things: there must be a healthy combination of passion and humility. To be inspired by something is to acknowledge that something or someone has done something that is worthy of dedicating your energy to. And then you must have passion in order to put inspiration into motion. Those two things are at the heart of what we do here. This is a truly inspired restaurant. And everything else sort of stems from there. It comes at the most unexpected times and the most unexpected places as long as you\\u2019re open to that.<\\/p><p>I really believe that we are at the forefront of the movement for Middle Eastern cuisine. Our restaurant is staying really true to form and doing at a level that the likes of which don\\u2019t really exist, but I think that it will one day. In hindsight&mdash;and this doesn\\u2019t come from a place of arrogance, it\\u2019s a hope&mdash; I would hope that as the movement starts to take places and this becomes more than just a trend, that we will be considered the restaurant that helped shape that and really set the bar for it. I think we\\u2019re really paving the way for something greater. You won\\u2019t necessarily see it now and you might not see it a year from now, but there is a much larger thing that is happening. It\\u2019s not tangible, but is definitely palpable.<\\/p>\"}}}}}', '2014-09-10 23:22:12', '2014-09-10 23:22:12', 'a177cd2a-a43e-44cd-9448-ddbb9627308e');
INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `num`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('204', '566', '6', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"400\",\"title\":\"Mamnoon Spotlight: Racha Haroun\",\"slug\":\"mamnoon-spotlight-racha-haroun\",\"postDate\":1390032000,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"\",\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"new1\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p><strong><\\/strong><strong>Mamnoon co-owner Racha Haroun on the Middle Eastern palate and impressing the moms.<\\/strong><\\/p>\"}},\"new2\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"565\"],\"position\":\"center\"}},\"new3\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p><strong><\\/strong><strong>Mamnoon has just recently celebrated one year in business. Congrats! Tell me a bit about the journey so far.<\\/strong><\\/p><p>It\'s been exciting-challenging but necessary. Since I am Syrian and Iranian, I feel that it\'s through the food that guests have been able to appreciate the warmth and compassion that have been part of our cultures for thousands of years. <\\/p><p>I grew up eating both foods and for many years shared my love and respect for the food with our friends. It felt like the right time to share with our adopted home, Seattle. We feel honored that people appreciate the experience and share the love of the food.  <\\/p><p>All the recent events and news are masking the good that\\u2019s in these ancient civilizations and I feel compelled to share these positive aspects with Seattle and the greater Northwest community. <\\/p><p><strong>How would you describe the role you play at the restaurant?<\\/strong><\\/p><p>I really love the creative aspect of mamnoon. Art has always been a very important part of my life and I taught myself to cook the foods that I grew up with while living in Seattle. <\\/p><p>I am proud to be part of the creative process of bringing mamnoon to life. Curating the guest experience from start to finish, the feel and the taste.  <\\/p><p>I was raised with the palate to know and appreciate good Lebanese, Syrian and Iranian cuisines. Our culinary team is exceptionally talented, but not necessarily totally experienced in the cuisine and the desired outcomes. I work closely with our executive chef Garrett Melkonian and the rest of the talented kitchen staff and have been excited to see that they\'ve started to acquire the palate and can now make authentic dishes better than I ever made. Even our most critical guests, our moms, approve! We apply a lot of creativity in presenting dishes that are common in the middle east, but new to most of our guests, to help make the dishes less mysterious and more approachable.<\\/p><p><strong>What have been some of the most rewarding and challenging aspects of the process?<\\/strong><\\/p><p>The most rewarding part is realizing that our hearts are in the right place. We are proud of our foods but we wanted to showcase it in a modern Northwest setting. <\\/p><p>We noticed that our children are very proud of our achievement and the fact that hard work and perseverance pays off. The hardest part has been the constant awareness that our families are living in a tense war situation with a very uncertain future. Caring and nurturing mamnoon keeps us busy and sane, while really highlighting the beautiful aspects of our culture.<\\/p>\"}}}}}', '2014-09-10 23:45:14', '2014-09-10 23:45:14', '326921df-2631-4aba-9cba-96a84ee8381c');
INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `num`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('205', '566', '6', '1', 'en_us', '2', '', '{\"typeId\":\"6\",\"authorId\":\"400\",\"title\":\"Mamnoon Spotlight: Racha Haroun\",\"slug\":\"mamnoon-spotlight-racha-haroun\",\"postDate\":1390032000,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"\",\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"567\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p><strong>Mamnoon co-owner Racha Haroun on the Middle Eastern palate and impressing the moms.<\\/strong><\\/p>\"}},\"568\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"565\"],\"position\":\"center\"}},\"569\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p><strong>Mamnoon has just recently celebrated one year in business. Congrats! Tell me a bit about the journey so far.<\\/strong><\\/p><p>It\'s been exciting-challenging but necessary. Since I am Syrian and Iranian, I feel that it\'s through the food that guests have been able to appreciate the warmth and compassion that have been part of our cultures for thousands of years. <\\/p><p>I grew up eating both foods and for many years shared my love and respect for the food with our friends. It felt like the right time to share with our adopted home, Seattle. We feel honored that people appreciate the experience and share the love of the food.  <\\/p><p>All the recent events and news are masking the good that\\u2019s in these ancient civilizations and I feel compelled to share these positive aspects with Seattle and the greater Northwest community.<br> <\\/p><p><strong>How would you describe the role you play at the restaurant?<\\/strong><\\/p><p>I really love the creative aspect of mamnoon. Art has always been a very important part of my life and I taught myself to cook the foods that I grew up with while living in Seattle. <\\/p><p>I am proud to be part of the creative process of bringing mamnoon to life. Curating the guest experience from start to finish, the feel and the taste.  <\\/p><p>I was raised with the palate to know and appreciate good Lebanese, Syrian and Iranian cuisines. Our culinary team is exceptionally talented, but not necessarily totally experienced in the cuisine and the desired outcomes. I work closely with our executive chef Garrett Melkonian and the rest of the talented kitchen staff and have been excited to see that they\'ve started to acquire the palate and can now make authentic dishes better than I ever made. Even our most critical guests, our moms, approve! We apply a lot of creativity in presenting dishes that are common in the middle east, but new to most of our guests, to help make the dishes less mysterious and more approachable.<\\/p><p><strong>What have been some of the most rewarding and challenging aspects of the process?<\\/strong><\\/p><p>The most rewarding part is realizing that our hearts are in the right place. We are proud of our foods but we wanted to showcase it in a modern Northwest setting. <\\/p><p>We noticed that our children are very proud of our achievement and the fact that hard work and perseverance pays off. The hardest part has been the constant awareness that our families are living in a tense war situation with a very uncertain future. Caring and nurturing mamnoon keeps us busy and sane, while really highlighting the beautiful aspects of our culture.<\\/p>\"}}}}}', '2014-09-10 23:45:38', '2014-09-10 23:45:38', 'b00048ba-b220-4559-b30b-54ff0776ad7d');
INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `num`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('206', '566', '6', '1', 'en_us', '3', '', '{\"typeId\":\"6\",\"authorId\":\"400\",\"title\":\"Mamnoon Spotlight: Racha Haroun\",\"slug\":\"mamnoon-spotlight-racha-haroun\",\"postDate\":1390032000,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"\",\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"567\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p><strong>Mamnoon co-owner Racha Haroun on the Middle Eastern palate and impressing the moms.<\\/strong><\\/p>\"}},\"568\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"565\"],\"position\":\"center\"}},\"569\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>\\r\\n\\t<strong>Mamnoon has just recently celebrated one year in business. Congrats! Tell me a bit about the journey so far.<\\/strong>\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tIt\'s been exciting-challenging but necessary. Since I am Syrian and Iranian, I feel that it\'s through the food that guests have been able to appreciate the warmth and compassion that have been part of our cultures for thousands of years.\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tI grew up eating both foods and for many years shared my love and respect for the food with our friends. It felt like the right time to share with our adopted home, Seattle. We feel honored that people appreciate the experience and share the love of the food.\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tAll the recent events and news are masking the good that\\u2019s in these ancient civilizations and I feel compelled to share these positive aspects with Seattle and the greater Northwest community.<\\/br>\\r\\n<\\/p>\\r\\n<p>\\r\\n\\t<strong>How would you describe the role you play at the restaurant?<\\/strong>\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tI really love the creative aspect of mamnoon. Art has always been a very important part of my life and I taught myself to cook the foods that I grew up with while living in Seattle.\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tI am proud to be part of the creative process of bringing mamnoon to life. Curating the guest experience from start to finish, the feel and the taste.\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tI was raised with the palate to know and appreciate good Lebanese, Syrian and Iranian cuisines. Our culinary team is exceptionally talented, but not necessarily totally experienced in the cuisine and the desired outcomes. I work closely with our executive chef Garrett Melkonian and the rest of the talented kitchen staff and have been excited to see that they\'ve started to acquire the palate and can now make authentic dishes better than I ever made. Even our most critical guests, our moms, approve! We apply a lot of creativity in presenting dishes that are common in the middle east, but new to most of our guests, to help make the dishes less mysterious and more approachable.\\r\\n<\\/p>\\r\\n<p>\\r\\n\\t<strong>What have been some of the most rewarding and challenging aspects of the process?<\\/strong>\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tThe most rewarding part is realizing that our hearts are in the right place. We are proud of our foods but we wanted to showcase it in a modern Northwest setting.\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tWe noticed that our children are very proud of our achievement and the fact that hard work and perseverance pays off. The hardest part has been the constant awareness that our families are living in a tense war situation with a very uncertain future. Caring and nurturing mamnoon keeps us busy and sane, while really highlighting the beautiful aspects of our culture.\\r\\n<\\/p>\"}}}}}', '2014-09-10 23:46:17', '2014-09-10 23:46:17', '913526f7-31ae-4cdd-9be4-6d9b27fe144c');
INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `num`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('207', '566', '6', '1', 'en_us', '4', '', '{\"typeId\":\"6\",\"authorId\":\"400\",\"title\":\"Mamnoon Spotlight: Racha Haroun\",\"slug\":\"mamnoon-spotlight-racha-haroun\",\"postDate\":1390032000,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"\",\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"567\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p><strong>Mamnoon co-owner Racha Haroun on the Middle Eastern palate and impressing the moms.<\\/strong><\\/p>\"}},\"568\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"565\"],\"position\":\"center\"}},\"569\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>\\r\\n\\t<strong>Mamnoon has just recently celebrated one year in business. Congrats! Tell me a bit about the journey so far.<\\/strong>\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tIt\'s been exciting-challenging but necessary. Since I am Syrian and Iranian, I feel that it\'s through the food that guests have been able to appreciate the warmth and compassion that have been part of our cultures for thousands of years.\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tI grew up eating both foods and for many years shared my love and respect for the food with our friends. It felt like the right time to share with our adopted home, Seattle. We feel honored that people appreciate the experience and share the love of the food.\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tAll the recent events and news are masking the good that\\u2019s in these ancient civilizations and I feel compelled to share these positive aspects with Seattle and the greater Northwest community.\\r\\n<\\/p>\\r\\n<p>\\r\\n\\t<strong>How would you describe the role you play at the restaurant?<\\/strong>\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tI really love the creative aspect of mamnoon. Art has always been a very important part of my life and I taught myself to cook the foods that I grew up with while living in Seattle.\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tI am proud to be part of the creative process of bringing mamnoon to life. Curating the guest experience from start to finish, the feel and the taste.\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tI was raised with the palate to know and appreciate good Lebanese, Syrian and Iranian cuisines. Our culinary team is exceptionally talented, but not necessarily totally experienced in the cuisine and the desired outcomes. I work closely with our executive chef Garrett Melkonian and the rest of the talented kitchen staff and have been excited to see that they\'ve started to acquire the palate and can now make authentic dishes better than I ever made. Even our most critical guests, our moms, approve! We apply a lot of creativity in presenting dishes that are common in the middle east, but new to most of our guests, to help make the dishes less mysterious and more approachable.\\r\\n<\\/p>\\r\\n<p>\\r\\n\\t<strong>What have been some of the most rewarding and challenging aspects of the process?<\\/strong>\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tThe most rewarding part is realizing that our hearts are in the right place. We are proud of our foods but we wanted to showcase it in a modern Northwest setting.\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tWe noticed that our children are very proud of our achievement and the fact that hard work and perseverance pays off. The hardest part has been the constant awareness that our families are living in a tense war situation with a very uncertain future. Caring and nurturing mamnoon keeps us busy and sane, while really highlighting the beautiful aspects of our culture.\\r\\n<\\/p>\"}}}}}', '2014-09-10 23:46:32', '2014-09-10 23:46:32', '0b03b428-a4c7-4442-b5a9-82caa442badf');
INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `num`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('208', '571', '6', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"400\",\"title\":\"We\'re pleased to announce the winners of our Cocktail Naming Contest! \",\"slug\":\"were-pleased-to-announce-the-winners-of-our-cocktail-naming-contest\",\"postDate\":1389340800,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"\",\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"new1\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p style=\\\"text-align: center;\\\">Below you\'ll find the 1st and 2nd place winners for all 11 our of specialty cocktails.<\\/p><p style=\\\"text-align: center;\\\">Thank you so much to everyone who participated and for all the creative outpouring!<\\/p><p style=\\\"text-align: center;\\\"><\\/p><p style=\\\"text-align: center;\\\"><strong>No. 1<\\/strong><br>1st place: SXSE<br>2nd place: High West Drifter<\\/p><p style=\\\"text-align: center;\\\"><br><\\/p><p style=\\\"text-align: center;\\\"><strong>No. 2<\\/strong><br>1st place: Desert Rose<br>2nd place: Marianne<\\/p><p style=\\\"text-align: center;\\\"><\\/p><p style=\\\"text-align: center;\\\"><strong>No. 3<\\/strong><br>1st place: Mamnoon Mule<br>2nd place: Kickin\\u2019 Kabul<\\/p><p style=\\\"text-align: center;\\\"><br><\\/p><p style=\\\"text-align: center;\\\"><strong>No. 4<\\/strong><br>1st place: Mighty Aphrodite<br>2nd place: Sassie Lassie<\\/p><p style=\\\"text-align: center;\\\"><\\/p><p style=\\\"text-align: center;\\\"><strong>No. 5<\\/strong><br>1st place: Old Beirut<br>2nd place: Figgin\\u2019 A,<\\/p><p style=\\\"text-align: center;\\\"><\\/p><p style=\\\"text-align: center;\\\"><strong>No. 6<\\/strong><br>1st place: Mediterranean Crossing<br>2nd place: Levantine Elixir<\\/p><p style=\\\"text-align: center;\\\"><\\/p><p style=\\\"text-align: center;\\\"><strong>No. 7<\\/strong><br>1st place: The French Rind<br>2nd place: Gin(ie) in a Bottle<\\/p><p style=\\\"text-align: center;\\\"><\\/p><p style=\\\"text-align: center;\\\"><strong>No. 8<\\/strong><br>1st place: Mid East Algonquin<br>2nd place: Chic Sheik<\\/p><p style=\\\"text-align: center;\\\"><\\/p><p style=\\\"text-align: center;\\\"><strong>No. 9<\\/strong><br>1st place: Night Owl<br>2nd place: Turkish Sunrise<\\/p><p style=\\\"text-align: center;\\\"><\\/p><p style=\\\"text-align: center;\\\"><strong>No. 10<\\/strong><br>1st place: Habibti<br>2nd place: Persephone Rising<\\/p><p style=\\\"text-align: center;\\\"><\\/p><p style=\\\"text-align: center;\\\"><strong>No. 11<\\/strong><br>1st place: Sheherazad\\u2019s Fire<br>2nd place: The Devil\\u2019s Wife<\\/p>\"}},\"new2\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"570\"],\"position\":\"center\"}}}}}', '2014-09-10 23:51:19', '2014-09-10 23:51:19', '56e5e8e1-4cfa-481e-aa90-700afd5db5b2');
INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `num`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('209', '571', '6', '1', 'en_us', '2', '', '{\"typeId\":\"6\",\"authorId\":\"400\",\"title\":\"We\'re pleased to announce the winners of our Cocktail Naming Contest! \",\"slug\":\"were-pleased-to-announce-the-winners-of-our-cocktail-naming-contest\",\"postDate\":1389340800,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"38\":\"\",\"48\":\"\",\"46\":\"\",\"47\":\"\",\"39\":{\"572\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"body\":\"<p>Below you\'ll find the 1st and 2nd place winners for all 11 our of specialty cocktails.<\\/p><p>Thank you so much to everyone who participated and for all the creative outpouring!<\\/p><p><strong>No. 1<\\/strong><br>1st place: SXSE<br>2nd place: High West Drifter<\\/p><p><strong>No. 2<\\/strong><br>1st place: Desert Rose<br>2nd place: Marianne<\\/p><p><strong>No. 3<\\/strong><br>1st place: Mamnoon Mule<br>2nd place: Kickin\\u2019 Kabul<\\/p><p><strong>No. 4<\\/strong><br>1st place: Mighty Aphrodite<br>2nd place: Sassie Lassie<\\/p><p><strong>No. 5<\\/strong><br>1st place: Old Beirut<br>2nd place: Figgin\\u2019 A,<\\/p><p><strong>No. 6<\\/strong><br>1st place: Mediterranean Crossing<br>2nd place: Levantine Elixir<\\/p><p><strong>No. 7<\\/strong><br>1st place: The French Rind<br>2nd place: Gin(ie) in a Bottle<\\/p><p><strong>No. 8<\\/strong><br>1st place: Mid East Algonquin<br>2nd place: Chic Sheik<\\/p><p><strong>No. 9<\\/strong><br>1st place: Night Owl<br>2nd place: Turkish Sunrise<\\/p><p><strong>No. 10<\\/strong><br>1st place: Habibti<br>2nd place: Persephone Rising<\\/p><p><strong>No. 11<\\/strong><br>1st place: Sheherazad\\u2019s Fire<br>2nd place: The Devil\\u2019s Wife<\\/p>\"}},\"573\":{\"type\":\"image\",\"enabled\":\"1\",\"fields\":{\"assets\":[\"570\"],\"position\":\"center\"}}}}}', '2014-09-10 23:51:53', '2014-09-10 23:51:53', '87a348e3-9d03-45ee-9278-dbdcd9598fd8