INSERT INTO `craft_matrixcontent_postblocks` (`id`, `elementId`, `locale`, `field_text_body`, `field_image_position`, `field_recipe_recipeName`, `field_recipe_ingredients`, `field_recipe_instructions`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('1', '470', 'en_us', '<p>At the end of every meal at mamnoon, we serve all our guests a small carafe of Café Blanc or “white coffee” to cap off their meal and facilitate digestion. Known was “Ahweh Bayda” in Arabic, Café Blanc is made with orange blossom extract and hot water and is sometimes sweetened with sugar or honey. Café Blanc is thought to have originated in Lebanon and is traditionally served after meals as a digestif and offered as a sign of hospitality at special occasions and gatherings all over the Arab world. Naturally caffeine and alcohol free, Café Blanc is also said to soothe the nerves and aid with stomach aches. Many Middle Eastern mothers will also give their colicky babies a small amount of orange blossom extract with water.</p><p>When making Café Blanc at home, remember that a little bit goes a long way. We like ours alongside a sweet little treat like nokhochi or baklawa.</p>', NULL, NULL, NULL, NULL, '2014-09-10 17:23:29', '2014-09-10 17:44:32', 'c002ed21-1c2a-4486-85d3-7e492f968166');
INSERT INTO `craft_matrixcontent_postblocks` (`id`, `elementId`, `locale`, `field_text_body`, `field_image_position`, `field_recipe_recipeName`, `field_recipe_ingredients`, `field_recipe_instructions`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('2', '471', 'en_us', NULL, NULL, 'Café Blanc', '[{\"col1\":\"2 cups\",\"col2\":\"hot water\"},{\"col1\":\"1 t.\",\"col2\":\"orange blossom extract\"},{\"col1\":\"\",\"col2\":\"sugar or honey to taste (optional)\"}]', '', '2014-09-10 17:23:29', '2014-09-10 17:44:32', '6f31c4b4-6124-4be5-a243-a9bb7f4a0510');
INSERT INTO `craft_matrixcontent_postblocks` (`id`, `elementId`, `locale`, `field_text_body`, `field_image_position`, `field_recipe_recipeName`, `field_recipe_ingredients`, `field_recipe_instructions`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('3', '472', 'en_us', NULL, 'right', NULL, NULL, NULL, '2014-09-10 17:23:29', '2014-09-10 17:44:32', '044f8333-3614-461c-b8e0-6d029a147010');
INSERT INTO `craft_matrixcontent_postblocks` (`id`, `elementId`, `locale`, `field_text_body`, `field_image_position`, `field_recipe_recipeName`, `field_recipe_ingredients`, `field_recipe_instructions`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('4', '473', 'en_us', '<p>We are dedicated to giving back to the people and cultures that inspire all that we do at mamnoon. Through various fundraising efforts, we have donated nearly $25,000 to the UNHCR Syrian Refugee Relief Fund to aid those displaced by the crisis in Syria and the Middle East.</p><p>Our ‘Khobz for Syria’ campaign donates 100% of the proceeds from a $5 basket of house-made specialty breads to the UNHCR. From the start of this project, these baskets have been one of our most popular menu items and a wonderful way for the mamnoon community to get involved with the giving effort.</p><p>We are also part of a larger fundraising effort in partnership with glassybaby, a Seattle-based glass blowing studio. Our restaurant features a “mamnoon special” glassybaby candle holder in an exclusive dark slate color. $20 from the sale of every mamnoon glassybaby is donated to Syrian relief.</p><p>The mamnoon special glassbaby is part of the larger glassybaby giving effort, a campaign that supports various charities and has donated over $2,000,000 through the sales of these beautifully simple glass candle holders. Thedouble-glazed slate glassybaby votives, on display throughout the restaurant, are only available at mamnoon.</p><p>We have also had an incredible community support through private events and individual donations.</p><p>For more information on mamnoon giving, or to make a donation, call 206.906.9606 or visit&nbsp;<a href=\"http://www.unhcr.org/emergency/5051e8cd6-52b1c61ec.html\" target=\"_blank\">http://www.unhcr.org/emergency/5051e8cd6-52b1c61ec.html</a>.</p>', NULL, NULL, NULL, NULL, '2014-09-10 17:43:49', '2014-09-10 21:30:21', '0ed993aa-4014-48af-b826-05df8bd1872a');
INSERT INTO `craft_matrixcontent_postblocks` (`id`, `elementId`, `locale`, `field_text_body`, `field_image_position`, `field_recipe_recipeName`, `field_recipe_ingredients`, `field_recipe_instructions`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('5', '476', 'en_us', NULL, 'right', NULL, NULL, NULL, '2014-09-10 21:27:37', '2014-09-10 21:30:21', '727a105c-d034-4762-8a66-1cca71f36b89');
