INSERT INTO `craft_searchindex` (`elementId`, `attribute`, `fieldId`, `locale`, `keywords`) VALUES ('487', 'field', '40', 'en_us', ' this image by mouneer al sharaani can be translated to enchantment is in the the colors the melodies the dew drops the fragrances and the flowers the artist is a syrian calligrapher designer and print maker living and working in cairo al sharaani gave birth to a new era of contemporary arab calligraphy through the synthesis of traditional techniques and modern styles and has received international recognition for his revitalization of the medium ');
