INSERT INTO `craft_searchindex` (`elementId`, `attribute`, `fieldId`, `locale`, `keywords`) VALUES ('491', 'field', '40', 'en_us', ' these photographs by iranian photographer babak kazemi are a contemporary interpretation of the legend of shirin and farhad as the story goes farhad was a stonemason who was in love with the beautiful shirin who was also desired by the powerful king khosrow shirin knew of farhad s love and used it to make the king jealous king khosrow attempted to get rid of farhad by ordering him to complete an impossible task to win shirin s hand he must move a mountain farhad s love proves to be stronger than either the king or shirin hadimagined and he takes on the task with zeal amazed at the reports of farhad s progress shirin travel to the mountain to see for herself after the long journey though she faints with fatigue and farhad places both shirin and her horse on his shoulders and carries them back to the palace kazemi revisits this 16th century tragedy to comment on the contemporary struggle of lovers who must leave their homeland to find the freedom to love as they choose for the artist the story reveals the message that love can overcome even the most difficult situations ');
