INSERT INTO `craft_searchindex` (`elementId`, `attribute`, `fieldId`, `locale`, `keywords`) VALUES ('493', 'field', '40', 'en_us', ' hassan hajjaj who was born in morocco and raised in london is a master of multiple mediums including furniture fashion interior and record album covers hajjaj synthesized these all into a series of sensational photo portraits in kesh angels these transcultural and trans medium images depict a distinct subculture of young moroccan women who work as henna tattoo artists and travel marrakesh on motorbike with pride and ease the women pose with their bikes wearing veils and abayas against vivid backdrops these photos are a jarring mix of old and new east and west global and local hajjaj plays with and upends stereotypes presenting his subjects as both traditional and defiantly modern which infuses his photos with electrifying tension ');
