INSERT INTO `craft_searchindex` (`elementId`, `attribute`, `fieldId`, `locale`, `keywords`) VALUES ('498', 'field', '39', 'en_us', ' wassefracha center i was born into a family from lattakia a syrian coastal city my childhood was blessed with amazing food inquisitive intellects music curiosity and a big dose of social cultural and religious open mindedness the levant was in rapid development from the mid 60 s to the early 70 s fueled by optimism trade and development funds from the massive oil resources of the arabian gulf countries the new breed of educated lebanese and syrian engineers businessmen and traders created a unique cultural blend of western advances influenced by centuries old traditions and talents sadly this period was stunted by escalating conflicts and tensions with israel and a civil war in lebanon that started in 75 that lasted well into the 80 s meanwhile the newly developed arabian gulf countries continued to move at warp speed to construct whole nations from scratch much of it fueled by levantine talent blood sweat and tears we moved to dubai in 77 after it was no longer possible to stay in beirut the go getting and welcoming atmosphere in dubai was contagious and it became a true home dubai was a truly diverse environment all nationalities imaginable working in all fields the diversity was reflected everywhere and with it came the appreciation of other cultures as well as getting a keen understanding of the enormous richness and value of the levantine cultures and way of life essentially dubai provided proof that the culture is exportable welcome and adaptable to many environments i went on to study computer science as an undergrad in cedar rapids iowa and as a grad in houston texas i was fortunate to be studying cs at a time of great advances in the field and at the birth of the pc revolution i went back to the middle east after my university studies at the time there was no real work for my skill set few companies needed serious programming so i did some sales and sales support while i wrote programs on the side for private clients it was an interesting mix on the one hand i had huge exposure to all types of people and personalities and a work schedule that matched theirs siesta or beach in the afternoon on the other i was trying to stay current with technology and make a career out of programming a client approached me with a task convert a program for the mac operating system to support arabic usage while i was working on that i was approached by a microsoft regional exec and eventually hired to do similar work at microsoft in seattle microsoft wanted to make their products work with languages that are written and read from right to left arabic farsi hebrew urdu while potentially large markets microsoft wanted to spend a minimum on r d until the revenue came in they looked for an engineer that could do the arabic adaptation and then have the other languages be an easy translation in 3 years i shipped arabic hebrew dos windows word for windows before going on to work on very different projects at microsoft in summer of 00 after a fun career at microsoft we moved to france to try something family oriented and different we settled in paris and had a full dose of joie de vie it was a fantastic experience four years of discovery fun travel learning and interesting work a prominent feature in most parisian neighborhoods is a weekly marche a farmers market that takes place in a designated open area you can find amazing meat cuts fish fruits veggies cheeses wines baked goods and mana eesh any marche you go to will have a stall that makes saj domed grill mana eesh and a variety of mezze cross the channel to london and levantine food is virtually a staple entire high streets lined with mana eesh shawarama and varieties of lebanese and syrian restaurants these thrive due to wide appeal to customers in their locales my work with a startup took me back to the us in 06 we had many choices of where to go but racha and we wanted to be back in seattle it just felt right it felt like going home we didn t think of it as a permanent move back rather talking about it as an indefinite move the return was a great relief wassefparty center paris society has its cultural constraints because of the closeness and the density the lebanese groups acted lebanese syrians acted syrian and the french acted french there was a lot of mixing of course but we didn t feel there were truly hybridized communities seattle like many us cities offers a fairly big hybrid community albeit one that doesn t have too many levantine cultural elements we felt a genuine open mindedness and ability to absorb other culture s elements proven by how well seattleites adopted japanese thai vietnamese and other asian cultures and made them part of the daily lives over the years we ve expressed our cultures through a variety of ways but the highest impact by far was when racha prepared lebanese syrian or persian food and served at our dinners and parties of course the foods are delicious and accessible and she s an amazing cook but the main reason has to do with the reception and the way guests are treated the accueil the feedback from our friends is that our cultures are welcoming accommodating adaptable progressive and contemporary but more importantly they remember the visceral delicious sensations generated by eating the foods taking in the smells and sights there is a direct correlation between a positive visceral stimulus with an unfamiliar context resulting in this context being familiarized in a very positive way this was the aha moment for us and the start of the mission we got excited about the prospect of building a business around these principles and to create the postive visceral stimuli and experiences accessible in the broadest way possible it was also clear that we hoped to for the mission to be a progressive beacon that the local culture can be proud of this was the genus of mamnoon and a fantastic problem for a geek like me to go work on i don t have a culinary background i am not a foodie or wine connoisseur i am not a typical sample of the lebanese or syrian cultures either but i am very curious i am a tinkerer and have a lot of humility to try new things and fail at them and i have no issues calling for help if i need it wassedj right the mamnoon project was a complete collaboration between racha and me entering into many areas that we have never been before and like every other project i have been in mamnoon is a headlong full contact affair made more intense by the fact that racha is fully in it as well this is a new and intense family dynamic we both bring it home and live it day and night it has helped us do better for mamnoon in a very natural way and has added a dimension of authenticity that is unparalleled i am talking about mamnoon in very personal way but what really makes it relevant and vibrant to all of us today is the team that has gelled behind the mission we are simply blessed to have some of the most talented individuals in the industry believe in what we are trying to do and to have taken on the mission as their own this is a testament that what we have lived and believe in is universal the excitement passion and drive we see in the staff translates to amazing guest experiences and a net cultural transfer all of it for the better as the main geek at mamnoon my work is endless there is a lot i need to do tinkering here and there helping on the technology working on processes and learning what it is that we can do to make the mamnoon experience universally compelling if you come by one day and see me around with a laptop measuring tape on top of a ladder under a piece of equipment or talking to a guest don t be surprised i m just geeking out wassef ');
