INSERT INTO `craft_searchindex` (`elementId`, `attribute`, `fieldId`, `locale`, `keywords`) VALUES ('537', 'field', '39', 'en_us', ' we are so excited to announce the start of mamnoon junoon a series held on the first monday of each month focusing on foods arts and humanities we are kicking off with a six course moroccan dinner on monday feb 3 in arabic junoon means a crazy party a fete if you will through this dinner we will bring aspects of middle eastern hospitality to help melt the ice that builds up with the seattle freeze the dinner will be served family style and will be done with community seating to facilitate discussion socialization and mutual appreciation of the delicious and perhaps unfamiliar food on the table we hope this to be a bonhomie of friends and strangers sitting down to enjoy a beautiful meal together mezze small bites carotte et orange shredded carrot cara cara orange concombre doux sweet cucumber orange blossom water merguez lamb sausage harissa salade salad fennouil shaved fennel oil cured olive soft herbs briwats pastry fromage de chevre fresh goat cheese parsley chive tarragon epaule d agneau confite lamb shoulder confit warm spices onion legume vegetable tajine seven vegetable tagine saffron ginger hand rolled couscous smen fresh buttermilk poisson fish bar roti roasted sea bass chermoula herb salad friandises treats gazelle horns tahini cookies tangerines dinner is $65 per person and does not include gratuity tax and beverage we apologize for the inconvenience but we are unable to make substitutions as it is a set menu reservations are required for the event as space is limited please note that because of the communal nature of the meal parties less than 8 may be grouped at a table with others if your party prefers to be at a private table please make a note on your reservation and we will try our best to accommodate but no promises reservations can be made at http mamnoonrestaurant com or at 206 906 9606 mamnoon to you ');
