INSERT INTO `craft_searchindex` (`elementId`, `attribute`, `fieldId`, `locale`, `keywords`) VALUES ('564', 'field', '40', 'en_us', ' i think people who are really observant don t necessarily look for inspiration but stumble upon it i could be inspired by a conversation that i have with racha and wassef about a memory from their childhood or it could be a memory of my own or it could be going to a 7 11 at 3 o clock in the morning and seeing something that i find really delicious for me the most important thing about inspiration is that it requires a harmony between two things there must be a healthy combination of passion and humility to be inspired by something is to acknowledge that something or someone has done something that is worthy of dedicating your energy to and then you must have passion in order to put inspiration into motion those two things are at the heart of what we do here this is a truly inspired restaurant and everything else sort of stems from there it comes at the most unexpected times and the most unexpected places as long as you re open to that i really believe that we are at the forefront of the movement for middle eastern cuisine our restaurant is staying really true to form and doing at a level that the likes of which don t really exist but i think that it will one day in hindsight and this doesn t come from a place of arrogance it s a hope i would hope that as the movement starts to take places and this becomes more than just a trend that we will be considered the restaurant that helped shape that and really set the bar for it i think we re really paving the way for something greater you won t necessarily see it now and you might not see it a year from now but there is a much larger thing that is happening it s not tangible but is definitely palpable ');
