INSERT INTO `craft_searchindex` (`elementId`, `attribute`, `fieldId`, `locale`, `keywords`) VALUES ('631', 'field', '40', 'en_us', ' hi there and welcome to the blog for mamnoon restaurant we ll be using this blog as a place to showcase everything mamnoon so make sure to stay tuned for menu updates photos background stories events recipes contests and much more we ve been going full throttle in seattle for 1 year now and we anticipate many more years to come check back for the background story as to how we got here and how we see it unfolding in the future we could not have arrived here without your amazing support and for that we say mamnoon as part of of our blog launch we will be posting all the details of our upcoming cocktail naming contest which runs from dec 1st 31st so keep an eye out for the final details and most importantly the magnificent prizes as the month unfolds ');
